import './App.css';
import {connect} from "react-redux";
import * as actionTypes from "./redux/actions"

const App = ( props ) => {

  console.log(props.name)
  return( 
      <div>
          <p></p>
      </div>
  );

} //End of App.

const mapStateToProps = state =>{
  return{
    myName: state.name
  };
}

const mapDispatchToProps = dispatch =>{
  return{
    onNameChange: (newName) => dispatch({type: actionTypes.CHANGE_NAME, name:newName}),
    onMinuteAdd: (minutes) => dispatch({type: actionTypes.ADD_MINUTES, minutesToAdd:minutes})
  }
}

export default connect(mapStateToProps,mapDispatchToProps)(App);
